def plot(result):

    plt.figure(1)  # 创建图表1
    plots = []
    for ti in range(len(result)):
        trend = result[ti]
        plt.figure(1)  # ❶ # 选择图表1
        keys = trend.keys()
        trend = sorted(trend.iteritems(), key=lambda d: d[0])
        keys.sort()
        for i in range(len(trend)):
            trend[i] = trend[i][1]
        # print trend
        plot = plt.plot(keys, trend, label=str(ti + 1))
        plots.append(plot)
        # print trend[0]

    plt.legend(loc='upper right')
    plt.show()

